    const handleNewUser = (event) => {
        setCustState(true);
    };

    const saveNewUser = (event) => {
        setCustState(false);
    };

    return (
        <div>
            <Form>
                <Form.Group>
                    <Form.Label>Project Name</Form.Label>
                    <Form.Control 
                        name={props.name} 
                        onChange={handleChange}
                        placeholder="What's the project name?" 
                    />
                </Form.Group>

                <InputGroup>
                    <FormControl
                        owner={props.owner} 
                        onChange={handleChange}
                        placeholder="What's your name?"
                    />
                    {/* <Dropdown.Item onClick={handleNewUser}>{values.projectOwner}</Dropdown.Item> */}
                </InputGroup>
{/* 
                {newCustState ? 
